const Chart = () => {
  const [chartData, setChartData] = useState({
    type: 'bar',
    height: 115,
    options: {
      chart: {
        sparkline: {
          enabled: true,
        },
      },
      colors: ['#fff'],
      tooltip: {
        theme: 'dark',
        fixed: {
          enabled: false,
        },
        y: {
          title: {
            formatter: (seriesName) => 'Sales/Order Per Day',
          },
        },
        marker: {
          show: false,
        },
      },
    },
    series: [
      {
        name: 'added to inventory',
        data: [2722, 2080, 2063, 1972, 1516, 2722, 2080, 2063, 1972, 1516, 2722, 2080, 2063, 1972, 1516, 2722, 2080, 2063, 1972, 2080],
      },
    ],
  });

  return (
    <div>
      {/* render the chart using the chartData object */}
      <Bar data={Chart} options={chartConfig.options} />
    </div>
  );
};

export default Chart;
